text107913.addInnerText('<div id=\"text107913\"><a id=\"text107913anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.409\" style=\"margin-left:0px;text-indent:0px;line-height:1.350;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text107913Font1\" style=\"position:relative;top:-2px;\" >Fairtrade er et internasjonalt merke for rettferdig handel mellom produsenter i U-land og forbrukere i vestlige land. Velger du fairtrade-merkede produkter, bidrar du til at bønder og arbeidere i får tryggere arbeidsvilkår, bedre priser og at råvarene er dyrket bærekraftig.\n</span ></p >\n<p  legLH=\"1.409\" style=\"margin-left:0px;text-indent:0px;line-height:1.350;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text107913Font1\" style=\"position:relative;top:-2px;\" >I Norge kan du finne merket på mange matvarer som bananer, juice, kaffe, kjeks, roser, ris, sjokolade, sukker og te, vin. Det er også andre handelsvarer som vil kunne har dette merket. For mer informasjon, se </span ><a href=\"javascript:trivExitPage(\'https://www.fairtrade.no/\',true)\"  ><span class=\"text107913Font2\" style=\"position:relative;top:-2px;\" >her.</span></a ><span class=\"text107913Font3\" style=\"background-color:transparentposition:relative;top:-2px;\" >\n</span ></p >\n</div>\n');

text102836.addInnerText('<div id=\"text102836\"><a id=\"text102836anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.409\" style=\"margin-left:0px;text-indent:0px;line-height:1.350;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text102836Font1\" style=\"position:relative;top:-2px;\" >Ø-merket er det offisielle norske økologimerket. Merkeordningen administreres av Debio, den norske godkjenningsinstansen for økologisk produksjon. Ø-merket gir en garanti for at en vare er økologisk dyrket. Det innebærer blant annet at det ikke brukes kunstgjødsel eller syntetiske sprøytemidler i produksjonen, og krav til dyrevelferd som er strengere enn i konvensjonelt landbruk. Ø-merket stiller også strenge krav til tilsetningsstoffer (E-stoffer). For at et produkt skal kunne Ø-merkes, må minst 95 prosent av ingrediensene være økologiske. Merket brukes først og fremst på mat og drikke, men brukes også på landbruksprodukter (gjødsel, såvarer mm), tekstiler og kosmetikk. For mer informasjon, se </span ><a href=\"javascript:trivExitPage(\'https://debio.no/\',true)\"  ><span class=\"text102836Font2\" style=\"position:relative;top:-2px;\" >her.</span></a ><span class=\"text102836Font3\" style=\"background-color:transparentposition:relative;top:-2px;\" >\n</span ></p >\n</div>\n');
